import FeedbackItem from "./FeedbackItem";

const FeedbackList = ({ feedback }) => {
    return (
        <div class>
            {feedback.map((item) => (
                <FeedbackItem
                    key={item.id}
                    rating={item.rating}
                    text={item.text}
                />
            ))}
        </div>
    );
};

export default FeedbackList;
